import EdificioCard from 'components/EdificioCard';

const Patologia = () => {
  return (
    <>
      <div className="container my-4">
        <div className="row">
          <div className="col-sm-6 col-lg-4 col-xl-6">
            <EdificioCard />
          </div>
          <div className="col-sm-6 col-lg-4 col-xl-6">
            <EdificioCard />
          </div>
          <div className="col-sm-6 col-lg-4 col-xl-6">
            <EdificioCard />
          </div>
          <div className="col-sm-6 col-lg-4 col-xl-6">
            <EdificioCard />
          </div>
        </div>
      </div>
    </>
  );
};

export default Patologia;
